SELECT /*+ MAX_EXECUTION_TIME(30000) */ first_name, last_name, salary 
FROM `employe` 
ORDER BY salary DESC LIMIT 5;

-- Number of projects the company has
SELECT COUNT(*) FROM `projects` LIMIT 50;

-- Number of completed projects
SELECT COUNT(*) FROM `projects` WHERE status = 'Completed' LIMIT 50;

-- Number of employees working on each project
SELECT p.name, COUNT(ep.employee_id) AS num_employees 
FROM `employee_projects` ep JOIN `projects` p ON ep.project_id = p.id GROUP BY p.name LIMIT 50;

-- Staffing quality for each project (1 - Poor, 2 - Fair, 3 - Good, 4 - Excellent)
SELECT p.name, COUNT(CASE WHEN e.hours_worked > 160 THEN 1 END) AS num_hours_over_160 
FROM `employee_projects` ep JOIN `projects` p ON ep.project_id = p.id JOIN `performace` e ON ep.employee_id = e.employee_id GROUP BY p.name LIMIT 50;

